@@ -55,7 +55,8 @@ proc scan-dump { args } {
     set src [file tail [lindex $testcase 0]]
     set output_file "[glob -nocomplain $src.[lindex $args 2]]"
     if { $output_file == "" } {
-	fail "$testname: dump file does not exist"
+	verbose -log "$testcase: dump file does not exist"
+	unresolved "$testname"
 	return
     }

